import React from 'react';
import ReactDOM from "react-dom";
import Header from "./Header";
import Details from "./details";
import Footer from "./footer"

ReactDOM.render(
  <div>
  <Header></Header>,
  <Details></Details>
  <Footer></Footer>
  </div>,
  document.getElementById("root")
)
